delegate.description:
Object related to the <code>Delegate</code> module that provides the required APIs to execute model-specific logic.<br> The object has the following properties: <ul> <li><code>name</code> defines the path to the <code>Delegate</code> module</li> <li><code>payload</code> (optional) defines application-specific information that can be used in the given delegate</li> </ul> <i>Sample delegate object:</i> <pre><code>{
	name: "sap/ui/mdc/BaseDelegate",
	payload: {}
}</code></pre> <b>Note:</b> Ensure that the related file can be requested (any required library has to be loaded before that).<br> Do not bind or modify the module. This property can only be configured during control initialization.

